import {useParams} from 'react-router-dom'
import {Dummy} from './EventsPage'

function EventDetail(){
    const params = useParams() 
    console.log(params)
    const id = params.id
   const absss= Dummy.find((data)=>data.id==id)
   const BSSS= Dummy.find((saa)=>saa.id==id)
    return <>
     <h1>EventDetail </h1>
    <ul>
        <li>{absss.title} </li>
    </ul></>
}
export default EventDetail
